Added comprehensive tests for two previously untested handler functions in `src/Oxpecker/Handlers.fs`:
- `htmlViewChunked` - Writes HTML elements with chunked transfer encoding
- `htmlChunked` - Writes async streams of HTML elements with chunked encoding

## Problems Found

The coverage analysis revealed that `htmlViewChunked` and `htmlChunked` handlers in `ResponseHandlers.fs` (lines 136-147 in Handlers.fs) had no test coverage. These are important functions for streaming HTML responses efficiently.

## Actions Taken

Added 4 new test cases to `tests/Oxpecker.Tests/Handlers.Tests.fs`:

1. **`htmlViewChunked writes HTML element with chunked encoding`** - Tests basic functionality with simple HTML element
2. **`htmlViewChunked with complex nested elements renders correctly`** - Tests with complex nested HTML structure including lists
3. **`htmlChunked writes async stream of HTML elements with chunked encoding`** - Tests streaming multiple HTML elements using IAsyncEnumerable
4. **`htmlChunked with empty stream writes empty response`** - Tests edge case of empty async sequence

All tests follow the existing test patterns in the file and verify:
- Correct HTML rendering
- Proper Content-Type header setting (`text/html; charset=utf-8`)
- Chunked encoding behavior

